import React from "react";

const Footer = () => {
  return (
    <>
      <footer class="w-100 bg-info text-center">
        <p>
          ©️ 2020 DipakPrajapati. All Rights Reserved | Terms and Conditions
        </p>
      </footer>
    </>
  );
};

export default Footer;
